def find_connectivity(ref_matrix, distances):
    
    for i in range(len(ref_matrix)):
        for j in range(len(ref_matrix[i])):
            if ref_matrix[i][j]==0:
                continue
            index = int(ref_matrix[i][j]-1)
            dir = [[1,0],[0,1],[-1,0],[0,-1]]
            for k in range(4):
                dx = i+dir[k][0]
                dy = j+dir[k][1]
            neighbor = int(ref_matrix[dx][dy]-1)
            if distances[index][neighbor]+distances[neighbor][index]==0:
                dis = random.uniform(2,10)
                distances[index][neighbor] = dis
                distances[neighbor][index] = dis
    return distances


