# Define the stress function
def stress(positions, distances):
    """Calculate the stress based on the difference between known and estimated distances."""
    positions = positions.reshape((len(distances), 3))
    estimated_distances = squareform(pdist(positions))
    mask = distances != 0
    return np.sum((mask * (distances - estimated_distances))**2)

# Define the optimization function
def optimize_positions(distances, initial_positions):
    """Optimize node positions to minimize stress."""
    stress_values = []  # Local storage for stress values
    callback = lambda x: stress_values.append(stress(x, distances))
    result = minimize(stress, initial_positions, args=(distances,), method='L-BFGS-B', callback=callback)
    return result.x.reshape((len(distances), 3)), result.fun, stress_values

# Define the plotting function
def plot_results(estimated_positions, stress_values):
    """Plot the estimated positions in 3D and the stress values over iterations."""
    fig = plt.figure(figsize=(16, 8))
    ax = fig.add_subplot(121, projection='3d')
    
    ax.scatter(estimated_positions[:, 0], estimated_positions[:, 1], estimated_positions[:, 2], c='red', label='Estimated Positions')
    ax.set_title('Estimated Positions by Optimization')
    ax.set_xlabel('X')
    ax.set_ylabel('Y')
    ax.set_zlabel('Z')
    ax.legend()
    plt.show()
    
    plt.figure()
    plt.plot(stress_values, marker='o')
    plt.title('Stress Value Over Iterations')
    plt.xlabel('Iteration')
    plt.ylabel('Stress')
    plt.grid(True)
    plt.show()


num_nodes = distances.shape[0]
