# Run the optimization
estimated_positions, final_stress, stress_values = optimize_positions(distances, initial_positions)

# Print outputs
print(f"Final Stress Value: {final_stress}")
print("Estimated Positions:\n", estimated_positions)
print("Estimated Distances Matrix:\n", squareform(pdist(estimated_positions)))

# Plot the results
plot_results(estimated_positions, stress_values)

